const response = $input.first().json;
const content = response.content?.[0]?.text || '';
const originalData = $('Parsuj p≈ô√≠kaz').first().json;

try {
  const jsonMatch = content.match(/\{[\s\S]*\}/);
  if (jsonMatch) {
    const parsed = JSON.parse(jsonMatch[0]);
    return [{
      json: {
        ...originalData,
        searchParams: parsed,
        searchQuery: encodeURIComponent(parsed.search_query || originalData.query)
      }
    }];
  }
} catch (e) {
