}

// Fallback
return [{
  json: {
    ...originalData,
    searchParams: { keywords: [originalData.query] },
    searchQuery: encodeURIComponent(originalData.query)
  }
}];

// Zpracuj v√Ωsledky a vytvo≈ô top 5
const heurekaHtml = $('Prohledej Heureka').first().json.body || '';
const temuHtml = $('Prohledej Temu').first().json.body || '';
const searchParams = $('Extrahuj search parametry').first().json;
const results = [];

// Parse Heureka
try {
  const productPattern = /<article[^>]*>([\s\S]*?)<\/article>/gi;
  let match;
  while ((match = productPattern.exec(heurekaHtml)) !== null && results.length < 3) {
    const block = match[1];
    const titleMatch = block.match(/title="([^"]+)"/i) || block.match(/<a[^>]*>([^<]{5,100})</i);
    const priceMatch = block.match(/(\d[\d\s]*[.,]?\d*)\s*(Kƒç|,-)/i);
    const urlMatch = block.match(/href="(https?:\/\/[^"]+)"/i);
    const imgMatch = block.match(/src="(https?:\/\/[^"]+\.(?:jpg|jpeg|png|webp)[^"]*)"/i);

    if (titleMatch && priceMatch) {
      results.push({
        nazev: titleMatch[1].trim().substring(0, 100),
        cena: priceMatch[1].replace(/\s/g, '').replace(',', '.'),
        url: urlMatch ? urlMatch[1] : '',
        obrazek: imgMatch ? imgMatch[1] : '',
        zdroj: 'Heureka'
      });
    }
  }
} catch (e) {
  console.error('Heureka parse error:', e.message);
}

// Parse Temu
try {
  const productPattern = /<div[^>]*data-product[^>]*>([\s\S]*?)<\/div>/gi;
  let match;
  while ((match = productPattern.exec(temuHtml)) !== null && results.length < 5) {
    const block = match[1];
    const titleMatch = block.match(/title="([^"]+)"/i);
    const priceMatch = block.match(/(\d+[.,]?\d*)\s*(Kƒç|CZK)/i);
    const urlMatch = block.match(/href="([^"]+)"/i);

    if (titleMatch && priceMatch) {
      results.push({
        nazev: titleMatch[1].trim().substring(0, 100),
        cena: priceMatch[1].replace(',', '.'),
        url: urlMatch ? 'https://www.temu.com' + urlMatch[1] : '',
        obrazek: '',
        zdroj: 'Temu'
      });
    }
  }
} catch (e) {
  console.error('Temu parse error:', e.message);
}

// Filtruj podle max ceny
let filtered = results;
if (searchParams.searchParams?.max_price) {
  filtered = results.filter(r => parseFloat(r.cena) <= searchParams.searchParams.max_price);
}

return [{
  json: {
    ...searchParams,
    results: filtered.slice(0, 5),
    totalFound: results.length
  }
}];

